    false,nt"url": null,nt"notes": "This annual narrative report for Chautauqua
    NWR outlines Refuge accomplishments during the 1966 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    timber removal and commercial fishing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, fishing,
    violations, and safety. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
